;; gorilla-repl.fileformat = 1

;; **
;;; # Yura's LGM
;; **

;; @@
(ns lgm
  (:use [embang runtime emit]
        [mrepl core]
        [gorilla-plot core]))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-nil'>nil</span>","value":"nil"}
;; <=

;; **
;;; We want to implement incrementally growing state space model.
;; **

;; @@
(defquery lgm
  "Yura's LGM"
  [observes rdb]
  (let [get-x (mem (fn get-x [t]
                     (if (= t -1) 0
                       (if (contains? rdb [:x :t t])
                         (let [s (get rdb [:x :t t])]
                           (observe (normal (get-x (- t 1)) 1) (get rdb [:x :t t]))
                           s)
                         (let [s (sample [:t t] (normal (get-x (- t 1)) 1))]
                           (predict [:x :t t] s)
                           s)))))
        get-y-dist (fn [t]
                     (normal (get-x t) 1))]
    (reduce (fn [_ [t v]]
              (observe (get-y-dist t) v))
            nil observes)
    (predict :y2 (sample* (get-y-dist 2)))))
        
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;lgm/lgm</span>","value":"#'lgm/lgm"}
;; <=

;; **
;;; We'll use LMH for inference.
;; **

;; @@
(def states (doquery :lmh lgm [[[1 5]] ]))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;lgm/states</span>","value":"#'lgm/states"}
;; <=

;; @@
(take 1 (drop 10 (map get-predicts states)))

